import React from "react";

class Home extends React.Component {

  state = {
    email: "",
    password: "",
  };
  
  onFormSubmit = async (event) => {
    event.preventDefault();
    console.log("pressed");
    await axios.get(
      "http://localhost:5000/login", {
      auth: {
        username: this.state.email,
        password: this.state.password
      }
    }
    ).then(
      
      (res) => {
        console.log(res)
        // sessionStorage.setItem("jwtToken", res.data.token)

        // CHECK IF CAN RETURN RESPONSE OF ADMIN/USER //
        if (res.status === 200) {
          // const navigate = useNavigate();
          // navigate("/login/success");
          // return (
          // <Link to={`/login/success`}>
          //     </Link>
          // )
          // return <Redirect to="/login" /> 
          return (<Navigate to="login/success" /> ) // cant navigate, need more research
        }
      }
    
    ).catch((err) => {
      console.log(err.response)
    })
  }

  render() {
    return (
      <div class="absolute top-0 w-full h-full bg-gradient-to-r from-[#ffa53b] to-[#f6c790]">

        {/* Navbar for logo */}
        <nav class="relative flex flex-col pt-2 px-6 bg-white/0 w-full">
          <div class="flex flex-row">
            <div class="self-center mr-2">
            <a href="/home"><img class="h-10 w-10 absolute left-4 top-6" src={process.env.PUBLIC_URL + '/CS Logoooo.PNG'} alt="Credit Suisse Logo" /></a>
            </div>
            <div>
              {/* relative for nav and absolute for the individual texts to set their positions */}
              <a href="/home" class="text-2xl no-underline text-[#013156] font-bold absolute left-16 top-4">Credit Suisse</a><br/>
              <a href="/home"class="text-s text-[#013156] absolute left-24 top-12">Volunteer</a>
            </div>
          </div>
        </nav>

        {/* Sign in form */}
        <div class="relative container mx-auto h-full">
          <div class="flex items-center justify-center h-full">
            <div class="lg:w-4/12 px-4">
              <div class="rounded-lg bg-[#ffffff]">

                {/* "Sign in with" and horizontal rule */}
                <div class="rounded-t p-6">
                  <h6 class="text-center text-blueGray-500 text-sm font-bold">Sign in with</h6>
                  <hr class="mt-6 border-b-1 border-blueGray-300" />
                </div>

                <div class="flex-auto px-4 lg:px-10 py-10 pt-0">
                  <form class="flex flex-col pt-3 md:pt-8">
                    {/* Email Address  */}
                    <div class="relative w-full mb-3">
                      <label class="block text-blueGray-600 text-xs font-bold mb-2">Email Address</label>
                      <input
                        class="border-0 px-3 py-3 placeholder-blueGray-300 text-blueGray-600 bg-blueGray-100 rounded text-sm shadow focus:ring w-full ease-linear transition-all duration-150"
                        type="text" 
                        name="email"
                        placeholder="john.doe@email.com"
                        onChange={(e) => {
                          this.setState({ email: e.target.value });
                        }}
                        
                      />
                    </div>

                    {/* Password */}
                    <div class="relative w-full mb-3">
                      <label class="block text-blueGray-600 text-xs font-bold mb-2">Password</label>
                      <input 
                        class="border-0 px-3 py-3 placeholder-blueGray-300 text-blueGray-600 bg-blueGray-100 rounded text-sm shadow focus:ring w-full ease-linear transition-all duration-150"
                        type="text" 
                        name="email"
                        placeholder="yourpassword"
                        onChange={(e) => {
                          this.setState({ password: e.target.value });
                        }}
                      />
                    </div>

                    {/* Forgot password */}
                    <div class="text-right">
                      <a
                        href="#pablo"
                        onClick={(e) => e.preventDefault()}
                        class="text-blueGray-400"
                      >
                        <small>Forgot password?</small>
                      </a>
                    </div>

                    {/* Sign in button */}
                    <div class="text-center mt-6">
                      <button type="submit"
                        class="bg-blueGray-800 text-white active:bg-blueGray-600 text-sm font-bold uppercase px-6 py-3 rounded shadow hover:shadow-lg outline-none focus:outline-none mr-1 mb-1 w-full ease-linear transition-all duration-150"
                        onClick={this.onFormSubmit}
                      >
                        Sign In
                      </button>
                    </div>
                  </form>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Home;
